def flatten_dict(obj: Mapping[str, Any], delimiter: str='.') -> Mapping[str, Any]:
    def _flatten_dict(obj, parent_key='', delimiter='.'):
        items = []
        for key, value in obj.items():
            new_key = f"{parent_key}{delimiter}{key}" if parent_key else key
            if isinstance(value, Mapping):
                items.extend(_flatten_dict(value, new_key, delimiter=delimiter).items())
            else:
                items.append((new_key, value))
        return dict(items)

    return _flatten_dict(obj, delimiter=delimiter)

